import { Link } from 'react-router-dom'
import "./Navbar.css"
const Navbar= () => {

    return (
        <>
            <ul className="main-nav">
                <li><Link to="/" className="">Home</Link></li>
                <li><Link to="/favoritos">Favoritos</Link></li>
            </ul>
        </>
    )
}

export default Navbar
